import React from 'react';
import { Link } from 'react-router-dom';
import './UserDashboard.css';

const UserDashboard = () => {
  return (
    <div className="user-dashboard">
      <h2>Welcome to Your Dashboard</h2>
      <p>This is the User Dashboard where you can browse restaurants, check your wallet balance, and view your order history.</p>
      <nav>
        <ul>
          <li><Link to="/browse-restaurants">Browse Restaurants</Link></li>
          <li><Link to="/wallet">Wallet Balance</Link></li>
          <li><Link to="/order-history">Order History</Link></li>
        </ul>
      </nav>
    </div>
  );
};

export default UserDashboard;
